css:
:host(:host) .gutter .line-number.gutter-green {
  color: #fff;
  background-color: #a8ff60;
}
:host(:host) .gutter .line-number.gutter-blue {
  color: #fff;
  background-color: #96cbfe;
}
:host(:host) .gutter .line-number.gutter-red {
  color: #fff;
  background-color: #cc6666;
}
.line.line-green {
  background-color: #a8ff60;
}
.line.line-blue {
  background-color: #96cbfe;
}
.line.line-red {
  background-color: #cc6666;
}
.highlight-green .region {
  background-color: #a8ff60;
}
.highlight-blue .region {
  background-color: #96cbfe;
}
.highlight-red .region {
  background-color: #cc6666;
}
.status-bar-latex-plus-mode-good {
  color: #a8ff60;
}
.status-bar-latex-plus-mode-action {
  color: #96cbfe;
}
.status-bar-latex-plus-mode-error {
  color: #cc6666;
}
